function WorkoutGenerator( props ) {  
  return (
    <div className="workout-generator">
      {props.map(item =>
        <div>
          key={ item.id }
          id={ item.id } 
          name={ item.name } 
          type={ item.type } 
          timing={ item.timing } 
          target={ item.target } 
        </div>)};
    </div>
  );
}

export default WorkoutGenerator;
